import { BarChart, Bar, XAxis, YAxis, Tooltip, Legend } from "recharts";

const data = [
  {
    name: "Mon",
    sales: 4000,
    purchases: 2400,
    amt: 2400
  },
  {
    name: "Tue",
    sales: 3000,
    purchases: 1398,
    amt: 2210
  },
  {
    name: "Wed",
    sales: 2000,
    purchases: 9800,
    amt: 2290
  },
  {
    name: "Thur",
    sales: 2780,
    purchases: 3908,
    amt: 2000
  },
  {
    name: "Fri",
    sales: 1890,
    purchases: 4800,
    amt: 2181
  },
  {
    name: "Sat",
    sales: 2390,
    purchases: 3800,
    amt: 2500
  },
  {
    name: "Sun",
    sales: 3490,
    purchases: 4300,
    amt: 2100
  }
];

export default function BarChartt() {
  return (
    <BarChart
      width={410}
      height={250}
      data={data}
      margin={{
        top: 5,
        right: 30,
        left: 20,
        bottom: 10
      }}
    >
      <XAxis dataKey="name" />
      <YAxis />
      <Tooltip />
      <Legend />
      <Bar dataKey="purchases" fill="#00000"/>
      <Bar dataKey="sales" fill="#777" />
    </BarChart>
  );
}
